import React from 'react';
import './index.css';
import TaskDisplay from './components/TaskDisplay.js'

function App() {

  return (
    <div className="grid grid-cols-1 gap-4 m-5 justify-center max-w-screen-md">
      <div>
        <h1 className="text-3xl font-bold font-sans">My Tasks</h1>
      </div>
      <TaskDisplay></TaskDisplay>
      <div className="form-check flex flex-row items-center">
            <input type="checkbox" className="w-4 h-4 rounded-full focus:ring-1" />
            <div className="ml-3">
                {/* <p className="text-base font-medium">Task Name</p>
                <p className="text-xs text-gray-500">Task Description</p> */}
                <input class="shadow appearance-none rounded text-gray-700 leading-tight " id="taskName" type="text" placeholder=""/>
             </div>
        </div>
      <div className="fixed right-5 bottom-5">
        <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full">+</button>
      </div>
    </div>
  );
}

export default App;
